import sys
sys.setrecursionlimit(100000000)

class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        out = self.subRec(s, t)

        if len(s) == out:
            return True
        else:
            return False

    def subRec(self, s, t):
        l1 = len(s)
        l2 = len(t)

        if l1 == 0 or l2 == 0:
            return 0

        if s[l1 - 1] == t[l2 - 1]:
            return 1 + self.subRec(s[:-1], t[:-1])
        else:
            return max(self.subRec(s, t[:-1]), self.subRec(s[:-1], t))


s ="leeeeetcode"
t = ""

Solution().isSubsequence(s, t)